import React from 'react';
import FacebookIcon from '@material-ui/icons/Facebook';

const Footer = () => {

return(
    <>
    <footer className="p-2">
        <div className="container">
            <div className="row">
                <div className="col col-md-6 small">&#169; Copyright 2020</div>
                <div className="col col-md-6 small text-right">Follow Us: <a href=""><FacebookIcon/></a></div>
            </div>
        </div>
    </footer>
    </>
)

}

export default Footer;
